import{_ as a}from"./chunks/index.VAya1KE4.js";import{c,o,G as e,k as t}from"./chunks/framework.BFEalnvt.js";import"./chunks/theme.B1I7hsVa.js";import"./chunks/getArrayRandomItem.LhrzGfRF.js";const b=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"params":{"pkg":680,"idList":[1158,1109,996,997,950,916,840,801,759,680,634,317,65,378,73,316,318,150,758,493,485,80,371,158,227,379,179,147],"data":{"id":680,"name":"青衣","summary":"青衣","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/04/141353238/77d70d7c49d4785dbb8d98438219cde7_7990459774903021190.png","avatar":{"m":"https://act-upload.mihoyo.com/nap-obc-indep/2024/12/30/76099754/a484cb0e998e165336c0e0d34a3fbc07_4618107659328274129.png","pc":"https://act-upload.mihoyo.com/nap-obc-indep/2024/07/31/141353238/9ef02e81d2d93044ae1fcd6c12a2d4c8_1386820727227039119.png"},"attrs":[["稀有度","S"],["属性","电"],["特性","击破"],["阵营","刑侦特勤组"]],"destiny":[["LEVEL1介电击穿","青衣进入战场时，立即使[闪络电压]回复至上限，并使其后继累积效率提升30%；发动[普通攻击：醉花月云转]时，若[闪络电压]已累积至上限，则使本次招式命中的敌人防御力降低15%，且自身对该目标的暴击率提升20%，持续15秒。「虽不会有生命危险，不过还请不要拒捕...」电流的方向和强度都经过精密的计算，保证每位嫌疑犯都能获得安全的电击体验。"],["LEVEL2四两拨千斤","[核心被动：千秋岁]中每层[羁服]提供的失衡易伤倍率提升效果提升至原本的135%；青衣攻击命中敌人时，若对其施加的[羁服]已叠加至层数上限，则自身对其造成的失衡值提升15%。旧文明典籍中记载的一种搏击技术，起初似乎是一种拳术而非棍术的技巧。「不必拘泥，其实手臂也是一种三节棍，嗯。」"],["LEVEL3多喝热水","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技] 技能等级+2「年轻人要注意养生，还是多喝热水吧。」每次青衣捧着保温杯啜饮的时候，都给人以非常温暖的感受。但接过她递上的热水时一定要小心——「就算是100度的开水前辈也能不动声色地喝下…」某位中过招的治安官留下了这样的记录。"],["LEVEL4稳态电弧屏障","进入或退出[闪络]状态时，获得等同于青衣10%生命值上限的护盾；护盾效果刷新时，如果上一次获得的护盾仍然存在，则为青衣回复5点能量，能量回复效果10秒内最多触发一次。怀斯塔学会逆向研究旧文明的钰偶而开发出的电弧屏障，是集防御、攻击、电能转换于一体的技术。「俗话说：水能载舟，亦能覆舟。物理学俗话又说：电流如水流。并联得到：电流进可攻退可守。真是相当好的结合。」"],["LEVEL5童心未泯","[普通攻击]、[闪避]、[支援技]、[特殊技]、[连携技] 技能等级+2「善，年轻人就要勇于尝试新的事物，加油！」虽然有时候会觉得青衣的鼓励里带着几分摸鱼、几分捉弄。但如果真的不幸捅了娄子，只要信赖她就可以了。毕竟是活了几百上千年的老家伙了，什么都能摆平。"],["LEVEL6奇经八脉","[普通攻击：醉花月云转]的打断等级大幅提升，招式的暴击伤害额外提升100%；青衣发动[普通攻击：醉花月云转]命中敌人时，目标的全属性伤害抗性降低20%，持续15秒。旧文明典籍中记载的对人体循环系统的一种学说，据说完整掌握这一理论后，可以在搏击中瞬间让对手失去行动能力。「下次试试让人发痒的穴位吧，找谁来试验呢？店长？还是朱鸢？」"]],"skill":[{"title":"普通攻击：一煞","desc":"点按发动：向前方进行至多四段的打击，造成物理伤害和电属性伤害；第三段攻击期间，连续点按可以维持连击，持续打击敌人，在此期间发动[闪避]，不会打断[普通攻击]的连击段数；第三段攻击期间，停止点按将会中断连击，自动衔接第四段攻击，维持连击超过一定时间后，第四段攻击将会得到强化；第三、第四段攻击期间抗打断等级提升，受到的伤害降低40%。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/14/76099754/43a7ad1106a6bbd4c8d18d79f80da49f_8586620128613141742.gif"},{"title":"普通攻击：醉花云","desc":"长按发动：向前方发动一次突进攻击，造成电属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/adf9df0b00ac0325037ad6cee6500894_5829209661710066632.gif"},{"title":"闪络","desc":"青衣发动招式造成电属性伤害时，会累积[闪络电压]，当[闪络电压]累积至75%时，青衣将进入[闪络]状态。发动[普通攻击：醉花月云转]时，青衣会消耗所有[闪络电压]并退出[闪络]状态，所消耗的[闪络电压]中超过75%的部分，每1%能够使本次招式造成的伤害/失衡值额外提升1%/0.5%。[普通攻击：醉花月云转]本身不会累积[闪络电压]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/6aa8ba81d3de0da831410834ca21dda8_5874691649372428578.gif"},{"title":"普通攻击：醉花月云转","desc":"[闪络]状态下，长按发动：向前方连续发动五次突进攻击，随后发动终结一击，造成大量电属性伤害，招式发动期间松开，可以提前发动终结一击；在角色即将受到攻击时发动终结一击，可以触发[极限闪避]。突进攻击发动期间抗打断等级提升，受到的伤害降低40%，终结一击发动期间具有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/6829bb3ce008f44b736bf76ae572171c_2168769353998912753.gif"},{"title":"闪避：雁过声","desc":"点按发动：快速的冲刺闪避；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/321e0bd1818b86d970b653fa9e53c343_8759229129825157871.gif"},{"title":"冲刺攻击：入破","desc":"闪避时，点按发动：向前突进后发动上挑攻击，造成物理伤害。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/838e45b49de0357915e4181aeafaf329_6858068171389715466.gif"},{"title":"闪避反击：意不尽","desc":"触发[极限闪避]后，点按发动：腾空跃起后发动下落攻击，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/1f8413b6850c7921262ca557f827de3b_6171005717389295515.gif"},{"title":"快速支援：风入松","desc":"当前操作中的角色被击飞时，点按发动：腾空跃起后发动下落攻击，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/a8404039dcd5015cae43aff1c3180152_1614445081269775153.gif"},{"title":"招架支援：锦上花","desc":"前场角色即将被攻击时，点按发动：招架敌人的攻击，累积大量失衡值；具有较为优秀的招架性能，承受高强度攻击时[支援点数]的消耗量降低;招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/b0fb1f6a3f0013ce762aec06d53b6a37_5155361826308062367.gif"},{"title":"支援突击：清江引","desc":"发动[招架支援]后，点按发动：向前方快速突进攻击并向地面注入电能，随后拔起引发爆炸，造成电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/26/160132993/7e69fcf392256515037b718b561e2bef_6869837508993390797.gif"},{"title":"特殊技：昼锦堂","desc":"点按发动：向前方快速上挑，随后发动下砸攻击，造成电属性伤害；招式发动期间抗打断等级提升。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/160132993/66f613cd4c132ea7160ab8ff127755b7_8777753229502076359.gif"},{"title":"强化特殊技：月上海棠","desc":"能量足够时，点按发动：向前方快速上挑后腾空跃起，转身连打后发动强力的下砸攻击，造成大量电属性伤害，长按时，可以额外消耗能量，提升转身连打的攻击次数；招式发动期间拥有无敌效果。招式发动后，可直接衔接第三段[普通攻击]。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/160132993/060c09632b4b66e336e87da5913234ca_6201530856559745703.gif"},{"title":"连携技：太平令","desc":"触发[连携技]时，选择对应角色发动：对前方大范围区域发动强力连续打击，造成大量电属性伤害；攻击命中敌人时，目标每拥有一层[核心被动：千秋岁]中的[羁服]，招式对其造成的伤害提升3%；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/27/160132993/59ed6adfd5df6e0d37a7813e22c91205_2112697516527541170.gif"},{"title":" 终结技：八声甘州","desc":"喧响等级达到[极]时，点按发动：对前方大范围区域发动强力连续打击，随后发动终结一击，造成大量电属性伤害；招式发动期间拥有无敌效果。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/09/15/82232455/fe987175bbe0158f9289404fdaaac8cf_2476877644027102668.gif"},{"title":"核心技","desc":"核心被动：千秋岁青衣在[普通攻击：醉花月云转]中发动终结一击命中敌人时，会对敌人施加5层[羁服]，最多叠加20层，每层[羁服]能够使目标的失衡易伤倍率提升2%；在[普通攻击：醉花月云转]中每发动一次突进攻击，终结一击将额外施加1层[羁服]，在发动终结一击时，若触发[极限闪避]，可以直接施加10层[羁服]；对普通或精英敌人施加[羁服]时，施加的层数翻倍；目标从失衡状态恢复时，对应[羁服]层数重置。（此处数据为初始数据）额外能力：阳关三叠队伍中存在[强攻]角色或与自身阵营相同的角色时触发：[普通攻击]造成的失衡值提升20%；此外，若青衣的冲击力高于120点，每超过1点冲击力会使自身的攻击力提升6点，通过这种方式最多使自身的攻击力提升600点。","icon":"https://act-upload.mihoyo.com/nap-obc-indep/2024/08/02/141353238/94d315b1658ff8aa841fb5f5c2abd869_9016734580846908827.gif"}]},"favModalLocalKey":"vitepress_game_zzz_role_fav_modal","favLocalKey":"vitepress_game_zzz_role_fav"},"relativePath":"game/zzz/role/680.md","filePath":"game/zzz/role/[pkg].md"}'),d={name:"game/zzz/role/680.md"},_=Object.assign(d,{setup(i){return(p,n)=>(o(),c("div",null,[e(t(a))]))}});export{b as __pageData,_ as default};
